/* */                 

@namespace url("http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul");

.tab-close-button {
    -moz-appearance: none!important;
     /* Style #1A */   list-style-image:url(data:image/png;base64,)!important; /* */
     /* Style #1B *   list-style-image:url(data:image/png;base64,)!important; /* */ 
     /* Style #2  *   list-style-image:url(data:image/png;base64,)!important; /* */
     /* Style #3A *   list-style-image:url(data:image/png;base64,)!important; /* */
     /* Style #3B *   list-style-image:url(data:image/png;base64,)!important; /* */
     /* Style #3C *   list-style-image:url(data:image/png;base64,)!important; /* */
    -moz-image-region: rect(0, 64px, 16px, 48px)!important; }
    
.tab-close-button[selected="true"]:hover,
.tab-close-button:hover {
    -moz-image-region: rect(0, 32px, 16px, 16px)!important; }

.tab-close-button[selected="true"]:active,
.tab-close-button:active {
    -moz-image-region: rect(0, 48px, 16px, 32px)!important; }
    
.tab-close-button[selected="true"] {
    -moz-image-region: rect(0, 16px, 16px, 0)!important; }


/* END */
